import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Typography from '@material-ui/core/Typography';
import ImgNo1 from './image/work-no-1.jpg';
import ImgNo2 from './image/work-no-2.png';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles({
  root: {
    maxWidth: 345,
  },
});

export default function ImgMediaCard() {
  const classes = useStyles();

  return (
    <Grid container className={classes.root} spacing={2}>
      <Grid item xs={12}>
        <Card className={classes.root}>
          <CardActionArea>
            <CardMedia
              component="img"
              alt="VR住宅物件紹介のUnity開発"
              height="140"
              image={ImgNo2}
              title="VR住宅物件紹介のUnity開発"
            />
            <CardContent>
              <Typography gutterBottom variant="h5" component="h2">
                VR住宅物件紹介のUnity開発
              </Typography>
              <Typography variant="body2" color="textSecondary" component="p">
                JavaScript/SketchUp Make/Unity3D
              </Typography>
            </CardContent>
          </CardActionArea>
        </Card>
        <Card className={classes.root}>
          <CardActionArea>
            <CardMedia
              component="img"
              alt="SaaSサービスの分析レポート自動生成ツール開発"
              height="140"
              // image="/static/images/cards/contemplative-reptile.jpg"
              image={ImgNo1}
              title="SaaSサービスの分析レポート自動生成ツール開発"
            />
            <CardContent>
              <Typography gutterBottom variant="h5" component="h2">
                SaaSサービスの分析レポート自動生成ツール開発
              </Typography>
              <Typography variant="body2" color="textSecondary" component="p">
                JavaScript/PHP(5)/MySQL
                <br />
                CodeIgniter/Ajax/json/jQuery
              </Typography>
            </CardContent>
          </CardActionArea>
        </Card>
      </Grid>
    </Grid>
  );
}
